import styled from "styled-components";

import Header from "../Header";

const StyledOnline = styled.div`
  width: 100%;
`;

const OnlineP = styled.p`
  font-size: 16px;

`;

const Online = ({ children }) => {
  return (
    <StyledOnline>
      <Header>
        <OnlineP>ONLINe (7)</OnlineP>
      </Header>
    </StyledOnline>
  );
};

export default Online;
